import { useState, useEffect } from 'react';

function NavBar() {
  const [menuOpen, setMenuOpen] = useState(false);
  const [activeLink, setActiveLink] = useState("home");

  useEffect(() => {
    const toggle = document.getElementById("header-toggle");
    const nav = document.getElementById("nav-menu");

    if (toggle && nav) {
      const handleToggle = () => {
        setMenuOpen((prev) => !prev);
      };

      toggle.addEventListener("click", handleToggle);

      return () => {
        toggle.removeEventListener("click", handleToggle);
      };
    }
  }, []);

  return (
    <>
      <link href='https://unpkg.com/boxicons@2.1.4/css/boxicons.min.css' rel='stylesheet' />
      <header class="header">
        <a href="#" class="header-logo">Clay</a>

        <div class="header-toggle">
          <i class="bx bx-menu" id="header-toggle"></i>
        </div>

        <nav class="nav" id="nav-menu">
          <div class="nav-content bd-grid">
            <a href="#" class="nav-perfil">
              <div class="nav-img">
                <img src="https://i.postimg.cc/Z5VcmyV0/perfil.jpg" alt="" />
              </div>

              <div>
                <span class="nav-name">Clay</span>
                <span class="nav-name">Mitchell</span>
              </div>
            </a>

            <div class="nav-menu">
              <ul class="nav-list">
                <li class="nav-item"><a href="#" class="nav-link active">Home</a></li>
                <li class="nav-item dropdown">
                  <a href="#" class="nav-link dropdown-link">About <i class="bx bx-chevron-down dropdown-icon"></i></a>

                  <ul class="dropdown-menu">
                    <li class="dropdown-item"><a href="#" class="nav-link">About me</a></li>
                    <li class="dropdown-item"><a href="#" class="nav-link">Location</a></li>
                    <li class="dropdown-item"><a href="#" class="nav-link">Studies</a></li>
                  </ul>
                </li><li class="nav-item dropdown">
                  <a href="#" class="nav-link dropdown-link">Works <i class="bx bx-chevron-down dropdown-icon"></i></a>

                  <ul class="dropdown-menu">
                    <li class="dropdown-item"><a href="#" class="nav-link">Recent Jobs</a></li>
                    <li class="dropdown-item"><a href="#" class="nav-link">Best Jobs</a></li>
                    <li class="dropdown-item"><a href="#" class="nav-link">Work Awards</a></li>
                  </ul>
                </li>
                <li class="nav-item"><a href="#" class="nav-link ">Skills</a></li>

                <li class="nav-item"><a href="#" class="nav-link ">Contact</a></li>
              </ul>
            </div>
          </div>
        </nav>
      </header>
    </>
  );
}

export default NavBar;
